exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://www.520tingshu.net/books/${bid}.html`,{cleaner:html=>cleanCatalogWrapper(html,/ul class="ul[^>]+>/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)},idRegex:/(?<id>\d+-\d+)\.html/})};